test.range.4094 <- function() assertThat(range(structure(1:3, .Dim = 3L, .Dimnames = list(c("a", "b", "c"))), structure(1:3, rando.attrib = 941L), na.rm = TRUE), identicalTo(c(1L, 3L)))
test.range.4095 <- function() assertThat(range(structure(1:3, .Dim = 3L, .Dimnames = list(c("a", "b", "c"))), structure(1:3, .Dim = 3L, .Dimnames = list(c("a", "b", "c"))), na.rm = TRUE), identicalTo(c(1L, 3L)))
test.range.4096 <- function() assertThat(range(structure("foo", class = "foo")), identicalTo(41))
test.range.4097 <- function() assertThat(range(structure(list(1L, "bar"), class = "bar")), identicalTo(45))
